import React from 'react';
import Titles from './Titles.js';
import Form from './Form.js';
import Weather from './Weather.js';

class App extends React.Component{
   render(){
    return(
      <div>
        <Titles />
        <Form />
        <Weather />
      </div>
   )
  }
}
export default App;
